import styled from "styled-components";

export const ComponentHistoryDetail = () => {
    return <StyledContainer>ComponentHistoryDetail</StyledContainer>;
};

const StyledContainer = styled.div`
    height: 100vh;
    width: 100%;
    position: fixed;
    top: 0;
    display: flex;
    /* text-align: center; */
    align-items: center;
    justify-content: center;
    max-width: 480px;
    background: rgba(0, 0, 0, 0.5);
`;
